const INITIALIZATE = 'INITIALIZATE'

let DefaultState = {
   Initializated : false
}

const InitializateReducer = (state = DefaultState, action) => {
    switch (action.type) {

        case INITIALIZATE : {
            return {
                ...state,
                Initializated : true
            }

        }

        default :
            return state

    }
}

export const initializating = () => ({type: INITIALIZATE})


